import React from 'react'
import { pricing } from '../global/Data'

function Pricing() {
    return (
        <section
            className="my-[30px] lg:mt-[100px]"
            data-aos='fade-right'
            data-aos-delay='400'
        >
            <div className='container mx-auto px-20'>
                <div className='flex flex-col justify-center items-center space-x-10'>
                    {pricing.map((item, idx) => {
                        return (
                            <div key={idx} className='flex flex-col items-center justify-center max-h-[600px] bg-red-200 border border-black mb-10'>
                                {/* image */}
                                <img src={item.img} alt="" />
                                <div className='font-bold mt-10'>
                                    {item.title}
                                </div>
                            </div>
                        )
                    })}
                </div>
            </div>
        </section>
    )
}

export default Pricing
